class Solution(object):
    def lengthOfLongestSubstringTooSlow(self, s):
        """
        :type s: str
        :rtype: int
        """
        if len(s) == 0:
            return 0
        longest = 0
        count = 1
        letterList = {s[0]}
        lastFix = 1
        ct = 1
        while ct < len(s):
            letter = s[ct]
            if letter in letterList:
                if count > longest:
                    longest = count
                count = 0
                letterList = {s[lastFix]}
                lastFix += 1
                ct = lastFix
            else:
                letterList.add(letter)
                ct += 1
            count += 1        
        if count > longest:
            longest = count
            
        if longest > len(s) - ct:
            return longest
        return longest
        
        
